from unittest import TestCase

from solution.xor_strings_2 import *


class TestStringsXOR(TestCase):
    def test_case_2(self):
        s = "1101111011000001001001010010001001111110001110100100100100001101101010101001110010000101011110111000"
        t = "1010001101111011110100010101111110101101100000001001110000110110001100011110100100001010001101010011"
        want = "0111110110111010111101000111110111010011101110101101010100111011100110110111010110001111010011101011"
        self.assertEqual(strings_xor(s, t), want)

    def test_case_6(self):
        s = ""
        t = ""
        want = ""
        self.assertEqual(strings_xor(s, t), want)

    def test_case_9(self):
        s = "10101"
        t = "00101"
        want = "10000"
        self.assertEqual(strings_xor(s, t), want)
